Create Table `floorgrindingadjustment`(
`Id` BIGINT(20) NOT NULL AUTO_INCREMENT,
`FranchiseeId` BIGINT(20) NULL ,
`DiameterOfGrindingPlate` varchar(255) Null,
`Area` DECIMAL(18,2) Null,
`AdjustmentFactor` DECIMAL(18,2) NULL ,
`IsPriceChangedByFranchisee` BIT(1) NULL DEFAULT b'0',
`IsActive` BIT(1) NULL DEFAULT b'0',
`IsDeleted` BIT(1) NULL DEFAULT b'0' ,
`DataRecorderMetaDataId` BigInt(20) null,
PRIMARY KEY (`Id`),
INDEX `fk_floorgrindingadjustment_franchiseeId_idx` (`FranchiseeId` ASC) ,
CONSTRAINT `fk_floorgrindingadjustment_franchiseeid_idx`
FOREIGN KEY (`FranchiseeId`)
REFERENCES `franchisee` (`Id`),
INDEX `fk_floorgrindingadjustment_datarecordermetadataId_idx` (`DataRecorderMetaDataId` ASC) ,
CONSTRAINT `fk_floorgrindingadjustment_datarecordermetadataId_idx`
FOREIGN KEY (`DataRecorderMetaDataId`)
REFERENCES `DataRecorderMetaData` (`Id`)
);

